{
    "id": null,
    "state": 1,
    "account_id": {{account_id}},
    "project_id": {{project_id}},
    "name": "<test-databricks-connection>",
    "type": "adapter",
    "details": {
        "adapter_id": 1628,
        "connection_details": {
            "fields": {
                "type": {
                    "metadata": {
                        "label": "Connection type",
                        "description": "",
                        "field_type": "hidden",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": "spark"
                },
                "method": {
                    "metadata": {
                        "label": "Method",
                        "description": "",
                        "field_type": "select",
                        "encrypt": false,
                        "options": [
                            {
                                "label": "ODBC",
                                "value": "odbc"
                            }
                        ],
                        "validation": {
                            "required": false
                        }
                    },
                    "value": "odbc"
                },
                "host": {
                    "metadata": {
                        "label": "Hostname",
                        "description": "The hostname of the Databricks account to connect to.",
                        "field_type": "text",
                        "encrypt": false,
                        "validation": {
                            "required": false,
                            "pattern": "databricks_hostname"
                        }
                    },
                    "value": "your-databricks-hostname.databricks.com"
                },
                "port": {
                    "metadata": {
                        "label": "Port",
                        "description": "The port to connect to Databricks for this connection.",
                        "field_type": "number",
                        "encrypt": false,
                        "validation": {}
                    },
                    "value": 443
                },
                "cluster": {
                    "metadata": {
                        "label": "Cluster",
                        "description": "The ID of the cluster to connect to (required if using a cluster)",
                        "field_type": "text",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": ""
                },
                "endpoint": {
                    "metadata": {
                        "label": "Endpoint",
                        "description": "The ID of the endpoint to connect to (required if using Databricks SQL Analytics)",
                        "field_type": "text",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": "<your-endpoint-id>"
                },
                "driver": {
                    "metadata": {
                        "label": "Driver",
                        "description": "",
                        "field_type": "hidden",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": "/opt/simba/spark/lib/64/libsparkodbc_sb64.so"
                },
                "organization": {
                    "metadata": {
                        "label": "Organization",
                        "description": "Optional",
                        "field_type": "text",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": ""
                },
                "user": {
                    "metadata": {
                        "label": "User",
                        "description": "Optional",
                        "field_type": "text",
                        "encrypt": false,
                        "validation": {
                            "required": false
                        }
                    },
                    "value": "<your-username>"
                }
            },
            "field_order": [
                "type",
                "method",
                "host",
                "port",
                "organization",
                "cluster",
                "endpoint",
                "user",
                "driver"
            ]
        }
    }
}

